import pptxgen from "pptxgenjs";


export class ERBCreator{
    create(analysts, RankTitle,systems,findingz) {
        //Cover Page
        let pres = new pptxgen();
        var img = new Image();
        //img.src = "http://yourimage.jpg";
        let slide = pres.addSlide();
        slide.addImage({ data: "image/png;base64,", x: '0', y: '0', w: '100%', h: '70%' });
        slide.addText("Name of Presenter: " + this.analystsToString(analysts), { x: '0', y: '4.5' });
        slide.addText(RankTitle, { x: '0', y: '5' });
        slide.addText("Cyber Experimentation & Analysis Division", { x: '0', y: '5.5' });
        //Page2
        slide = pres.addSlide();
        slide.addImage({ data: "image/png;base64,", x: '0', y: '0', w: '100%' });
        slide.addText("Systems assessed during the CVPA are as follows: ", { x: '1', y: '2' });
        for (let i = 0; i < systems[0].length; i++) {
            //console.log(systems[0][i].name)
            slide.addText(systems[0][i].name + " ", { x: '1', y: String(2.5+i/4) })
        }
        //page 3
        slide = pres.addSlide();
        slide.addImage({ data: "image/png;base64,", x: '0', y: '0', w: '100%', h: '10%' });

        let rows = [
            ["ID", "System", "Finding", "Impact", "Risk"],
            ["1", "kfjns", "blah", "VH", "Low"],
            ["2", "kfjns", "blah", "VH", "Moderate"],
            ["3", "TestSystem3", "New Hosting", "M", "Moderate"],
        ];
        slide.addTable(rows, { h: "0.3",w: "100%" });
        //page 4
        slide = pres.addSlide();
        slide.addImage({ data: "image/png;base64,", x: '0.2', y: '0.2', w: '90%', h: '90%' });
        //page 5
        slide = pres.addSlide();
        slide.addImage({ data: "image/png;base64,", x: '0.2', y: '0.2', w: '90%', h: '90%' });
        //page 6
        slide = pres.addSlide();
        slide.addImage({ data: "image/png;base64,", x: '0.2', y: '0.2', w: '90%', h: '90%' });

        //Graph
        slide = pres.addSlide();
        let veryLow = 0;
        let low = 0;
        let medium = 0;
        let high = 0;
        let veryHigh = 0;

        for (let i = 0; i < findingz[0].length; i++) {
            if (findingz[0][i].risk === "Very Low")
                veryLow++;
            if (findingz[0][i].risk === "Low")
                low++;
            if (findingz[0][i].risk === "Moderate")
                medium++;
            if (findingz[0][i].risk === "High")
                high++;
            if (findingz[0][i].risk === "Very High")
                veryHigh++;
        }
        let dataChartAreaLine = [
            {
                name: "Findings Risk",
                labels: ["Very Low", "Low", "Medium", "High", "Very High"],
                values: [veryLow, low, medium, high, veryHigh],
            }];
        slide.addImage({data: "image/png;base64,", x: '0', y: '0', w: '100%',h:'15%' });
        slide.addChart(pres.ChartType.bar, dataChartAreaLine, { x: 1, y: 1, w: 8, h: 4 });
        //pres.writeFile("ERB.pptx");
        return pres.writeFile("ERB.pptx");
    }
    analystsToString(analysts) {
    let str = ""

    for (var i = 0, len = analysts.length; i < len; i++) {
        str += analysts[i].name + " ";
    }
    return str
    }
    
}